import Navibar from "./componetns/navbar";
import IphonePar from './componetns/parallax/iphone_main'
import MacPar from './componetns/parallax/macbook_main'
import MacintoshPar from './componetns/parallax/macintosh'




function App() {
  return (
    <>
      <Navibar/>
      <IphonePar/>
      <MacPar/>
      <MacintoshPar/>
    </>
  );
}

export default App;
